import React from "react";

import MainSearch from "./components/MainSearch";
import './App.css';
class App extends React.Component{

  constructor(){
    super();
    this.state={
      allfishes:[],
      compare:{fish_1_ID:"",fish_2_id:""},
    }
  }

  componentDidMount(){
    fetch('https://acnhapi.com/v1a/fish').then(resp=>resp.json).then(json=>this.setState({allfishes:json}));
  }
  render=()=>(
    <MainSearch/>
  );
}



export default App;
